import { Button } from "devextreme-react";
import React from "react";
import { SUPRow1, SUPRow1Col1, SUPRow1Col2 } from "./pageStyles";

const UniversityPage = () => {
  const openNewTab = (url) => {
    window.open(url, "_blank", "noreferrer");
  };

  return (
    <SUPRow1>
      <SUPRow1Col1>
        <Button
          onClick={openNewTab(
            "https://clip.fct.unl.pt/utente/eu/aluno/acto_curricular/inscri%E7%E3o/turnos?institui%E7%E3o=97747&aluno=103867"
          )}
        ></Button>
      </SUPRow1Col1>
      <SUPRow1Col2>22</SUPRow1Col2>
    </SUPRow1>
  );
};

export default UniversityPage;
